"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["3936"],{10222:function(A){A.exports=JSON.parse('{"name":"Trigger","url":"https://codeberg.org/woodpecker-plugins/trigger","icon":"https://codeberg.org/woodpecker-plugins/trigger/media/branch/main/logo.png","description":"Plugin to trigger manual or deployment pipelines of a repository.","docs":"<p>Woodpecker CI plugin to trigger a manual or deployment pipeline of another repository. This plugin is a fork of <a href=\\"https://github.com/drone-plugins/drone-downstream/\\">drone-plugins/drone-downstream</a>.</p>\\n<h2>Features</h2>\\n<ul>\\n<li>Trigger one or multiple pipelines</li>\\n<li>Trigger as manual or deployment pipeline</li>\\n<li>Pass variables to pipelines</li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>server</code></td>\\n<td>current server</td>\\n<td>Woodpecker CI server URL to call</td>\\n</tr>\\n<tr>\\n<td><code>token</code></td>\\n<td><em>none</em></td>\\n<td>Woodpecker CI API token for server</td>\\n</tr>\\n<tr>\\n<td><code>repositories</code></td>\\n<td><em>none</em></td>\\n<td>Repository names to trigger pipelines for</td>\\n</tr>\\n<tr>\\n<td><code>deploy</code></td>\\n<td><em>none</em></td>\\n<td>The environment to deploy to (if not set / empty, triggers a manual pipeline)</td>\\n</tr>\\n<tr>\\n<td><code>params</code></td>\\n<td><em>none</em></td>\\n<td>List of params (key=value or file paths of params) to pass to triggered pipelines</td>\\n</tr>\\n<tr>\\n<td><code>params-from-env</code></td>\\n<td><em>none</em></td>\\n<td>List of environment variables to pass to triggered pipelines</td>\\n</tr>\\n<tr>\\n<td><code>wait</code></td>\\n<td><code>false</code></td>\\n<td>To wait for any currently running pipeline to finish</td>\\n</tr>\\n<tr>\\n<td><code>timeout</code></td>\\n<td><code>60s</code></td>\\n<td>How long to wait on any currently running pipelines</td>\\n</tr>\\n<tr>\\n<td><code>last-successful</code></td>\\n<td><code>false</code></td>\\n<td>To trigger last successful pipeline</td>\\n</tr>\\n</tbody></table>\\n<h3>repositories</h3>\\n<p>Multiple repositories whose pipelines need to be triggered can be provided.\\nAlso it\'s possible to provide specific branch to trigger can be specified with <code>@</code> separator, ex. <code>owner/repo@branch</code>.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  name: trigger-downstream:\\n  image: woodpeckerci/plugin-trigger\\n  settings:\\n    repositories:\\n      - octocat/hello-world@master\\n      - octocat/sample\\n    token:\\n      from_secret: woodpecker_token\\n</code></pre>\\n<pre><code class=\\"language-yaml\\">steps:\\n  - name: publish\\n    image: woodpeckerci/plugin-trigger\\n    settings:\\n      repositories:\\n        - octocat/hello-world\\n      deploy: production\\n      params:\\n        - DATABASE=prod\\n      wait: true\\n      token:\\n        from_secret: woodpecker_token\\n    when:\\n      branch: ${CI_REPO_DEFAULT_BRANCH}\\n      event: push\\n</code></pre>\\n","tags":["woodpecker","trigger","pipeline"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-trigger","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-trigger","verified":true,"iconDataUrl":"data:image/png;base64,"}')}}]);